import React from "react";
import '../stylesheets/AboutMe.css'

function AboutMe() {
  return (
    <div className='aboutMe-container'>
      <div className='img-container'>
        <img src='https://i.pinimg.com/280x280_RS/e3/c1/f9/e3c1f9153ec167d189637efb3028b518.jpg' alt='me' />
      </div>
      <div className='information-container'>
        <h2>Who I am?</h2>
        <div>My name is Aitor Couñago Figueroa. I was physiotherapist and now I like to resolve some coding problems.</div>
        <div>The first time I seriously meet the software development was when my brother-in-law went to study a bootcamp in London and showed me some of the things he developed and how the software development works.</div>
        <div>I love logic and puzzles, so I immediately saw the charm of programming. However, it wasn't until I had a patient, who was a software developer, that I seriously considered leaving my profession. He encouraged me to take the step and he told me something that lit the spark in my head: it is a profession in which you can grow.</div>
        <div>I love physical therapy and I fought really hard to get into university to become a physical therapist, but it is a profession where there is zero room for growth. So I thought, if I can become a physical therapist, I can become a software developer.</div>
        <div>Empecé a estudiar Python sin mucho éxito, porque todo me parecía muy abstracto. Así que empecé a buscar una guía de ruta. Encontré Freecodecamp y empecé a estudiar por mi cuenta en el orden que lo proponían y todo empezó a hacerse más claro. En un mes ya era capaz de crear mi primera página web con HTML y CSS, en los siguientes dos meses ya resolvía problemas con JavaScript.</div>
      </div>
    </div>
  )
}

export default AboutMe;
